import { Link } from "react-router-dom"
import { isAuthenticated } from "../services/Auth"
import "./NavbarFire.css"
export default function Nav(props){


    return ( <nav className="navbar navbar-expand-md navbar-dark bg-info navbarfire">
                <a className="navbar-brand" href="#"><img className="imgfire" src="logobook.png" alt="logo"/></a>
      
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarsExampleDefault" aria-controls="navbarsExampleDefault" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarsExampleDefault">
                    <ul className="navbar-nav mr-auto"  >
                        {!isAuthenticated()?<li className="nav-item "><Link className="nav-link pull-right  lifire" to="/register">Register</Link></li>:null}
                        {!isAuthenticated()?<li><Link className="nav-link  lifire" to="/login" >Login</Link></li>:null}
                        {isAuthenticated()?<li className="nav-item"><Link className="nav-link lifire" to="/dashboard" >Dashboard</Link></li>:null}
                        {isAuthenticated()?<li><a className="nav-link lifire"  onClick={props.logoutUser} style={{cursor:"pointer"}} >Logout</a></li>:null}
                    </ul>
                </div>
            </nav>)
}
